Die #Coronavirus-Infektionen beim medizinischen Personal in 🇩🇪 steigen laut RKI-Lagebericht weiter - und wie zuvor sogar etwas schneller als insgesamt. 

Die Fallzahl wird mit 8539 angegeben, der Anteil beträgt nun 5,6%. 

@welt https://t.co/eGiCsDrz3A

Das RKI korrigiert seine Schätzung für die Reproduktionszahl R in 🇩🇪 um ein Hunderstel nach oben - von 0,75 auf 0,76.

Fragt sich, wem oder was mit solcher simulierten Präzision gedient ist. 🙄

@welt https://t.co/GBPcSXDzWr

Aktuell müssen 144 #Coronavirus-Infizierte in 🇩🇪  künstlich beatmet werden, geht aus dem neuen RKI-Lagebericht hervor. 

Das ist immer noch weit als im April, als die Zahl zeitweilig bei 2000+ lag. ABER auch das höchste Niveau seit dem 7. Juli.

